import React from 'react'

export default function TopInfo() {
    return (
        <div>
            <h1>ASHESI UNIVERSITY<br/> EXPENTIAL TRANSCRIPT </h1>
            <p>The Ashesi Experiential Transcript captures students’ endeavours in ways that demonstrate<br/> their assimilation of the values of Ashesi University: Scholarship, Leadership and Citizenship.<br/> Ashesi University validates all information presented on a student’s Ashesi Experiential<br/> Transcript. Each record in this transcript is verified and evaluated using the standard of the<br/> university’s core values.</p>
        </div>
    )
}
